import { Component } from "react";
import { useHistory } from "react-router";
import "./App.css"


export default class Profile extends Component {
    constructor(props) {
        super()
        this.state = {
            user: {}
        }
    }

    componentDidMount() {
        fetch("http://localhost:3001/profile").then(response => response.json()).then(responseJson => {
            this.setState({user: responseJson.data})
        })  
    }


    render() {
        return (
            <div className="App">
                <div className="Profile">
                    <h1>{this.state.user[0]}</h1>
                </div>
            </div>
        )
    }
}
